import { echo } from './Brodscat';

function App() {

  const echoNotification = () => {
    echo
    .channel('chats.1')
    .listen('ChatMessageCreated', ev => console.log(ev.message));
  };

  useEffect(() => {
    echoNotification();
  }, []);

  return (
    <div className="App">
      <h1>Teste</h1>
    </div>
  );
}

export default App;
